export default function returnSearch(string, listToRender, profileData) {
  let temp = {}

  const removeValue = (list) => {
    //Removes first and last item in the list.
    return list.slice(1)
  }

  listToRender.forEach((listItem) => {
    let returnedList = []
    let currentList = []

    profileData[listItem.toLowerCase()]?.forEach(value => {
      value.slice(1).forEach((item, i) => {
        if (item.data.toLowerCase().includes(string.target.value.toLowerCase())) {
          console.log(item['key'])
          if (!currentList.includes(item['key'])) currentList.push(item['key'])
        }

  // console.log(currentList)
      // profileData[value][0].slice(1).forEach((e) => {
      //   console.log(e.data)
  //       //   if (!currentList.includes(e[0])) currentList.push(e.key)
  //       //   // returnedList.push(value);
        // };
      })
    })
  //   console.log(currentList)
  })

  return temp
}
